import React from 'react';
import './App.css';
import { Route, BrowserRouter, Link } from "react-router-dom";
import Navbar from './Components/Navbar';
import Breakfast from './Components/Breakfast'




class App extends React.Component {
  constructor(){
    super();
    this.state ={
      Breakfast :[{
          image:"https://images.unsplash.com/photo-1525351484163-7529414344d8?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=500&q=60",
          name:"bread with sunny side-up egg served on white ceramic plate",
          price:120,
          rating:4.3

      }]
    }
  render() 
    return (
      <BrowserRouter>
        <React.Fragment>
          <Link to="/"></Link>

          <Route path="/" exact component={Navbar} />

          <Route path="/" exact component={Breakfast} />

        </React.Fragment>
      </BrowserRouter>
    );
    }
  }












export default App;
